IF OBJECT_ID('dbo.proc_transform_413', 'P') IS NOT NULL
    DROP PROCEDURE dbo.proc_transform_413;
GO
CREATE PROCEDURE dbo.proc_transform_413
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_413
    SET payload = LEFT(payload, 1000) + N'|V4-413|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_413;
END
GO
IF OBJECT_ID('dbo.audit_v4_413', 'U') IS NULL
